import React from 'react';
import ticketList from './ticketList.json';

function Tickets () {
    const tick = ticketList.tickets;
    const tickSort = tick.price;

    for (let i = 0; i < tickSort.length; i++) {
        for (let j = i; j < tickSort.length; j++){
            if (tickSort[i] > tickSort[j]){
                let temp = tickSort[i];
                tickSort[i] = tickSort[j];
                tickSort[j] = temp;
            }
            console.log(tickSort);
        }
    }

    return(
        <ul>
            {tick.map(item => (
                <li key={item.price}>
                    {item.origin}
                    {item.origin_name}
                    {item.destination}
                    {item.destination_name}
                    {item.departure_date}
                    {item.departure_time}
                    {item.arrival_date}
                    {item.arrival_time}
                    {item.carrier}
                    {item.stops}
                    <div>{item.price}</div>
                </li>
            ))}
        </ul>
    )
}

export default Tickets;
